        let ukraineData = [
            <?php while (have_rows('map_ukraine')): the_row();?>
            {
                id: "<?= get_sub_field('name') ?>",
                stableColor: "<?= get_sub_field('stable_color') ?>",
                hoverColor: "<?= get_sub_field('hover_color') ?>",
                patient: <?= get_sub_field('patient') ?>,
            },
            <?php endwhile;?>
        ];
        let europeData = [
            <?php while (have_rows('map_europe')): the_row();?>
            {
                id: "<?= get_sub_field('name') ?>",
                stableColor: "<?= get_sub_field('stable_color') ?>",
                hoverColor: "<?= get_sub_field('hover_color') ?>",
                patient: <?= get_sub_field('patient') ?>,
            },
            <?php endwhile;?>
        ];
        ukraineData.forEach( function (item) {
            let id = '#' + item.id;
            $(id).attr('data-toggle', 'tooltip');
            $(id).attr('data-placement', 'top');
            $(id).attr('fill', item.stableColor);
            $(id).attr('title', ukraineRegions[item.id] + ' область, пациентов ' + item.patient);
            $(id).hover(function (e) {
                $(this).attr('fill', item.hoverColor)
            }, function (e) {
                $(this).attr('fill', item.stableColor)
            });
        });
        europeData.forEach( function (item) {
            let id = '#' + item.id;
            if ( item.id === 'russia') {
                id = '#russia, #russia1'
            }
            $(id).attr('data-toggle', 'tooltip');
            $(id).attr('data-placement', 'top');
            $(id).attr('fill', item.stableColor);
            if (item.id === 'russia') {
                $(id).attr('fill', item.stableColor);
            }
            $(id).attr('title', europeRegions[item.id] + ', пациентов ' + item.patient);
            $(id).hover(function (e) {
                if (item.id === 'russia') {
                    $(id).attr('fill', item.hoverColor)
                }
                $(this).attr('fill', item.hoverColor)
            }, function (e) {
                if (item.id === 'russia') {
                    $(id).attr('fill', item.stableColor)
                }
                $(this).attr('fill', item.stableColor)
            });
        });
        $('[data-toggle="tooltip"]').tooltip()
    })
